import App from "next/app";
import Layout from "../components/styles/Layout";
import Header from "../components/Header";
import Footer from "../components/footer";

function MyApp({ Component, pageProps }) {
  return (
    <Layout>
      <Header />
      <Component {...pageProps} />;
      <Footer />
    </Layout>
  );
}

export default MyApp;
